import React, { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import '@fortawesome/fontawesome-free/css/all.min.css';
import './Home.css';
import Login from './Login';

function Home() {
  const [activeTab, setActiveTab] = useState('home');
  const [showLogin, setShowLogin] = useState(false);

  const handleLoginClick = () => {
    setShowLogin(true);
  };

  const handleCloseLogin = () => {
    setShowLogin(false);
  };

  return (
    <div className="container">
      <aside className="sidebar closed">
        <div className="sidebar-header">
          <h2>RGUKT Event Management</h2>
        </div>
        <nav className="nav">
          <ul>
            <li>
              <button onClick={() => setActiveTab('home')}>
                <i className="fas fa-home"></i>
                <span className="nav-text">Home</span>
              </button>
            </li>
            <li>
              <button onClick={handleLoginClick}>
                <i className="fas fa-sign-in-alt"></i>
                <span className="nav-text">Login</span>
              </button>
            </li>
            <li>
              <button onClick={() => setActiveTab('dashboard')}>
                <i className="fas fa-tachometer-alt"></i>
                <span className="nav-text">Dashboard</span>
              </button>
            </li>
            <li>
              <button onClick={() => setActiveTab('event-planning')}>
                <i className="fas fa-calendar-alt"></i>
                <span className="nav-text">Event Planning</span>
              </button>
            </li>
            <li>
              <button onClick={() => setActiveTab('event-promotion')}>
                <i className="fas fa-bullhorn"></i>
                <span className="nav-text">Event Promotion</span>
              </button>
            </li>
            <li>
              <button onClick={() => setActiveTab('volunteer-management')}>
                <i className="fas fa-users"></i>
                <span className="nav-text">Volunteer Management</span>
              </button>
            </li>
            <li>
              <button onClick={() => setActiveTab('resource-management')}>
                <i className="fas fa-cogs"></i>
                <span className="nav-text">Resource Management</span>
              </button>
            </li>
            <li>
              <button onClick={() => setActiveTab('feedback-analytics')}>
                <i className="fas fa-chart-line"></i>
                <span className="nav-text">Feedback & Analytics</span>
              </button>
            </li>
          </ul>
        </nav>
      </aside>
      <main className="main-content">
        <header className="header">
          <h1>Welcome to RGUKT Event Management</h1>
        </header>
        <section className="content">
          {activeTab === 'home' && <p>Manage and participate in events seamlessly.</p>}
          {activeTab === 'dashboard' && <p>View your dashboard and stats here.</p>}
          {activeTab === 'event-planning' && <p>Plan your events efficiently.</p>}
          {activeTab === 'event-promotion' && <p>Promote your events to a wider audience.</p>}
          {activeTab === 'volunteer-management' && <p>Manage your volunteers effectively.</p>}
          {activeTab === 'resource-management' && <p>Manage resources for your events.</p>}
          {activeTab === 'feedback-analytics' && <p>Analyze feedback and improve your events.</p>}
          {showLogin && <Login show={showLogin} handleClose={handleCloseLogin} />}
        </section>
      </main>
    </div>
  );
}

export default Home;
